//BookBike.jsx
import React from 'react';
import { useSearchParams } from 'react-router-dom';
import BikeCard from '../components/BikeCard';

const bikeData = [
  {
    id: 1,
    model: 'Royal Enfield Classic',
    price: 800,
    imageUrl: 'https://source.unsplash.com/800x600/?enfield,bike',
    location: 'Hyderabad',
  },
  {
    id: 2,
    model: 'Honda Activa',
    price: 400,
    imageUrl: 'https://source.unsplash.com/800x600/?activa,scooter',
    location: 'Chennai',
  },
  {
    id: 3,
    model: 'Yamaha FZ',
    price: 500,
    imageUrl: 'https://source.unsplash.com/800x600/?yamaha,bike',
    location: 'Hyderabad',
  },
];

function BookBike() {
  const [searchParams] = useSearchParams();
  const location = searchParams.get('location') || '';
  const date = searchParams.get('date') || '';
  const sort = searchParams.get('sort') || '';

  const filteredBikes = bikeData
    .filter((bike) =>
      bike.location.toLowerCase().includes(location.toLowerCase())
    )
    .sort((a, b) => {
      if (sort === 'price') return a.price - b.price;
      if (sort === 'model') return a.model.localeCompare(b.model);
      return 0;
    });

  return (
    <div className="p-6 bg-gray-100 text-black dark:bg-gray-900 dark:text-white min-h-screen">
      <h2 className="text-2xl font-bold text-blue-600 dark:text-blue-300 mb-2">ðŸ“… Book Your Ride</h2>
      <p className="text-green-600 font-bold mb-4">âœ… BookBike loaded with filters!</p>

      <div className="mb-4 space-y-2">
        <p><strong>Location:</strong> {location || 'Any'}</p>
        <p><strong>Date:</strong> {date || 'Not selected'}</p>
        <p><strong>Sort:</strong> {sort || 'None'}</p>
      </div>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredBikes.map((bike) => (
          <BikeCard key={bike.id} bike={bike} />
        ))}
        {filteredBikes.length === 0 && (
          <p className="text-gray-700 dark:text-gray-300">
            No bikes found for that location.
          </p>
        )}
      </div>
    </div>
  );
}

export default BookBike;
